export function addTodo(task) {
	return {
		type: 'ADD_TODO',
		payload: task
	}
}

export function deleteTodo(taskId) {
	return {
		type: 'DELETE_TODO',
		payload: taskId
	}
}

export function toggleTodo(taskId) {
	return {
		type: 'TOGGLE_TODO',
		payload: taskId
	}
}
